    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];


function App() {

 const seasons = ["Spring", "Summer", "Autumn", "Winter"];

  let seasonsList = [];

  seasons.forEach((season, index) => {
    seasonsList.push(<li key={index}>{season}</li>);
  });
  //;

  return (

    <div>
      <h2>Seasons of the year</h2>
      <ul>{seasonsList}</ul>
    </div>

  );


}



export default App;
